import math

def calculate_volume(radius):
    step = 1.001
    volume = 0
    for x in range(int(radius * 1000)):
        height = math.sqrt(radius ** 2 - (x / 1000) ** 2)
        area = math.pi * (x / 1000) ** 2
        volume += area * step
    return round(volume)

